    tmp3 = zeros(3,3);
    for jj = 1:3
        for kk = 1:3
            tmp3(jj,kk) = I(i,jj,kk);
        end
    end
    Ja = Ja + tmp3 - m(i)*wave(r(i,:))*wave(r(i,:)-r(7,:));
