            tmp2(:,j) = k(j,:).';
        end
    end
    tmp3 = zeros(3,3);
    for jj = 1:3
        for kk = 1:3
            tmp3(jj,kk) = I(i,jj,kk);
        end
    end
    Jb = Jb + m(i)*(wave(rg)-wave(r(i,:)))*tmp1-tmp3*tmp2;
end
